import './App.css';
import { BrowserRouter as Router, Route, Routes, Navigate} from 'react-router-dom';
import Welcome_page from "./windows/welcom_page";
import Main from './windows/main';
import authorize from './utilis/authorize'

async function App() {

    authorize.CheckAuthorize().then(
        data => {

            const logged = data !== null
            // console.log('Zweryfikowana sesja: ' + data.toString() ,data)
            return (
                <Router>
                    <Routes>
                        <Route exact path='/' element={logged ? <Navigate to="/dashboard" replace /> : <Welcome_page />}>

                        </Route>
                        <Route path='/dashboard' element={<Main/>}/>
                    </Routes>
                </Router>
            );
        }
    )
}

export default App;
